import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import {NavigationContainer} from "@react-navigation/native"
import {createStackNagigator} from "react-navigation/stack"

const Stack = createStackNagigator()

import  UserList from "./telas/UserList"
import  CreateUser from "./telas/CreateUser"
import  UserDetail from "./telas/UserDetail"


function MyStack() {
      return (
        <Stack.Navigator>
          <Stack.Screen name="UserList" component={UserList} />
          <Stack.Screen name="CreateUser" component={CreateUser} />
          <Stack.Screen name="UserDetail" component={UserDetail} />
        </Stack.Navigator>
      )
}

export default function App() {
  return (
    <NavigationContainer>
        <MyStack/>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
